window.bookSummaryJSON = "<p>Late Victorian London. When the most respectable of Scottish businessmen is pulled, dead, from the Thames, his daughter is drawn into an investigation which reveals a whole world of secrets and corruption and leads all the way to the tragic truth behind the ghostly legend of <i>The Darkwater Bride</i> â€“ in an epic drama combining the genres of the Victorian mystery thriller with the equally classic Victorian mode of the ghostly tale.</p> <p>Featuring: Rachel Atkins, Amy Cooke-Hodgson, Clare Corbett, Stephen Critchlow, Donal Finn,Jamie Glover, Peter Gold, Joel Gorf, Chris Grahamson, Edward Harrison, David Holt, Frances Jeater, Yolanda Kettle, Fiz Marcus, Freya Mavor,Gerard McDermott, Nina Millns, James Parkes, Richard Reed, Adrian Scarborough, Lizzie Stables, Mark Straker, Ben Whitehead, Sarah Whitehouse and Sarah-Louise Young.</p>"; 
